export default function Searchbar() {
  function toggleStockedProd(e) {
    console.log(e.tager.value);
  }
  return (
    <div>
      <input type="text" required id="search" placeholder="Search..." />
      <div>
        <input
          type="checkbox"
          onChange={toggleStockedProd}
          required
          id="stocked"
        />
        <span>Show only stocked products</span>
      </div>
      <br />
    </div>
  );
}
